import logo from './logo.svg';
import './App.css';
import {Heading, Icon} from 'react-bulma-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEllipsisV, faSlidersH } from '@fortawesome/free-solid-svg-icons';
import { useState, useEffect } from 'react';
import 'bulma/css/bulma.min.css';


function Header(props) {
  const style = {
    "paddingTop": "100px"
  }

  return (
    <div>
      <p style={style} className="title is-1">Gym Cal</p>
      <hr/>
    </div>
    );
}

function DayCard(props) {
  return (
    <div className="card">
      <header className="card-header">
        <p className="card-header-title">
          Card header
        </p>
        <button className="card-header-icon" aria-label="more options">
          <span className="icon">
            <i className="fas fa-angle-down" aria-hidden="true"></i>
          </span>
        </button>
      </header>
    </div>
    );
}

function WeekRow(props) {
  const [days, setDays] = useEffect([1, 2, 3, 4, 5, 6, 7])
  return (
      <div class="columns">
        {days.map((value, index) => {DayCard()})}
      </div>
    )
}

function Calendar() {
  return (
    WeekRow()
    );
}

function App() {
  return (
    <div className="App">
      <div className="container">
        {Header()}
        {Calendar()}
      </div>
    </div>
  );
}

export default App;
